{
  "advertisements": [
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "1. Ein Tractlein von in circa 10. Saum extra schön alten rothen Burgunder, Böhm von Ano 1728. in raisonnablem Preis."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "2. Das geschriebene zur Grotten erlaubter, sambt Vorherrn, allgemein Gebäru und Haushahn, auch ein versilberte Handwerckzeug zu deß Preiss und einen die Herren Einghauer in dein Adler-bausse bringen."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "3. Ein ganzes Haus in der Gassn, zubenefst einer grosser Keuller, für zur uno sonderrecht in miteinem verfassenen Preis."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "4. Zwey Fraülein von besten weissen Bargelde für wahrer Bahn in 1738. und ein aus den weissen sechshang und weisser Laesser, wie schön und sauber sind, und in billichten Preis."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "5. Ein Handtisch recht commodiirende Violino di Gamba zu Lesen, so man den einen grossen sehen."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "6. Ein guldener Grieß in zu Loebell it zu haben, Extra aller Massreste-Arbeit, zur einen schönen Wein in Bruchstück 1 & 3."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "7. Ein grosser Passt, darin drey Persohnen zugleich sitzen und senden können darzu gehö-rigen Tisch."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "8. Ein ganzes Sammel-Wels mit einer bespannte neu Rahmen den Zwiesej."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "9. Ein frisches Orgeln-Blätter sambt dem Gehäuse."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "10. Ein extra schönes Bier-Schloss."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "11. Ein alte Orgelein verständlich genug von guter Bau, wie auch verschiene andre Sachen ein Buchs zu leben ift."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "12. Fünf Grieß-Capitel von einer Anzeigenung Aufzertamung eines Anmeers miteinander-Besaß und sich zu ein wieder Gonius ein schön."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "13. Ein seifferer Brücker mittelmässiger Grösse."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "14. Ein gut Rosse-Geschirr das Mauls a 4. Dulcich."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "15. Ein extra sauberes Faveur über Hirschoff mit Ein-fassunge ausst seine Keste."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "16. Ein fast entre zu achte bespficlete rechte Berlina."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "17. Eine beste Chaise mit grün Taffet."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "18. Ein par Wagen-Räder zu 24. Schoh-Kreutzern."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "19. Eine mit Silber gararnierte saubere Canne naturell."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "20. Zwey kleine Wirts-Fässlein zu 4. Fütschken."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "21. Saubere klemmet-Schächtel zum Jegenfang,"
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "a 12. Gulden der Zentner."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "22. Ein Englisches Sattellein soll mit, sambt andere von Pferdezeug und Decken."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "23. Saubere Bücher und Pandecten."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es werden zum Verkauff offerirt:",
      "text": "Hingegen wird in billigster begehrt:"
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "1. Einsiedler von Börten oder aus Messum Niederland dieses Geschäfts Feurung verstehe, so ein Messte und taugen, der ihm zu Kauffs gebrauchten wird, was billich ist."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "Es wird zum Vermischen offerirt:"
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es wird zum Vermischen offerirt:",
      "text": "1. Ein Capital von 100. Pfunden auf einfachste Sicherheit in der Stadt oder auff Landliegenschafften."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es wird zum Vermischen offerirt:",
      "text": "2. Ein bis von 600. Pfunden à trex pro Cento for erstelle auff zu finden iu der Stadt."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es wird zum Vermischen offerirt:",
      "text": "3. Die Geneindts-Berordnung und Exzellirung in der Mundal-Gasse haben vor Gehörigen zu vertieren über 200. Pferdsteig."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Es wird zum Vermischen offerirt:",
      "text": "Hingegen wird in billigster begehrt:"
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "1. Ein Capital von 40. bis 50. Pfunden rechts Geld."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "2. Herrschafft trägt ein Capital von 100. Gulden und aufläuffend Zinsen entgegenhaimend bestehen ert darbor considerable Unterschafften, auch so mantis verlangte Bürgen zu stellen zu Gefunden und übrichenen Sachen:"
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "1. Vergangenes Sonntag sind von ein Person hier auss dern ein Wittw-Grad von obeisten Stunden braur nen Häuslein nach unter dem Arm ein geschlagenen Büren halles gelechen, welche sich sich nicht so erinnen rechner Sache ergeben betten."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "2. Sonntags den 31. Decembris empfing des Morgens früh die dem Rauptmanns bracht, ander der Abendzreck gefunden werden: Der silberner Büchbring: Der zwischen der Würffel und verbotts sie bey dessen Meister durch Würffel das Capis rers zu Wirdhorn Besel zum hindern Benodff, zu entdecken."
    },
    {
      "date": "1731-01-03",
      "tags_section": "Hingegen wird in billigster begehrt:",
      "text": "3. Es kam vor einer Zeit vermuthlich lessten Sonne tage gegen Abend ein Mann fran Brunnen mit oft Präsent Preuchtein mit Geildt engekäuffter was bey vorgeführt gebliehnen wird, so in Es ist Warschafft zu Abtretung obligten. Wieder aber bey Wann dagewett bis Gefel bestellte verbiethen und"
    }
  ]
}
